import './App.css';
import Navbar from './components/Navbar';
import TextForm from './components/TextForm';


function App() {
  return (
    <>
      <Navbar title="TextUtils" aboutText="About Us " />
      <div className="container my-4">
        <h1> Enter your text.</h1>
        <TextForm />
      </div>
    </>
  );
}

export default App;
